import React, { useState } from "react";
import * as Styled from "./styles";
import axios from "axios";
import { Form } from "../form/form";
import { CompanyProfiles } from "../company-profiles/company-profiles";
import { validateCompanyName } from "../../validator/company-profiles";

/**
 *
 * @returns
 */
export const Dashboard = () => {
  const [searchValue, setSearchValue] = useState({
    name: "",
    dateFrom: "",
    dateTo: "",
  });
  const [symbols, setSymbols] = useState([]);
  const [count, setCount] = useState(0);
  const [companyProfileValues, setCompanyProfileValues] = useState([]);
  const [stockCandles, setStockCandles] = useState({});
  const [errors, setErrors] = useState("");

  const onFormSubmit = async (e) => {
    e.preventDefault();

    validateCompanyName(searchValue, setError);

    setSymbols([]);
    setCount(0);
    setCompanyProfileValues([]);
    try {
      const responseSymbols = await getSymbols();
      setSymbols(responseSymbols.result);
      setCount(responseSymbols.count);

      getCompanyProfiles(responseSymbols.result);
      console.log("SYMBOLS ", responseSymbols);
    } catch (error) {
      console.log(error);
    }
  };

  const getCompanyProfiles = async (sym, from = 0, to = 5) => {
    try {
      let companyProfiles = await Promise.all(
        sym
          .slice(from, sym.length > to ? to : sym.length)
          .map(async (element) => await getSingleCompanyProfile(element.symbol))
      );

      companyProfiles = companyProfiles.filter((element) => {
        setCount((count) => --count);
        return element?.name ? true : false;
      });

      setCompanyProfileValues(companyProfileValues.concat(companyProfiles));
    } catch (error) {
      console.log(error);
    }
  };
  const getSingleCompanyProfile = async (companySymbol) => {
    return new Promise((resolve, reject) => {
      console.log("single symbol to be fetched", companySymbol);
      const FINNHUB_COMPANY_PROFILE_API = `${process.env.REACT_APP_FINNHUB_COMPANY_PROFILE_API}?symbol=${companySymbol}&token=${process.env.REACT_APP_FINNHUB_TOKEN}`;

      axios
        .get(FINNHUB_COMPANY_PROFILE_API)
        .then((response) => {
          console.log(response);
          resolve(response.data);
        })
        .catch((err) => {
          console.log(err);
          return reject(err);
        });
    });
  };

  const getSymbols = async () => {
    return new Promise((resolve, reject) => {
      const FINNHUB_COMPANY_SYMBOLS_API = `${process.env.REACT_APP_FINNHUB_SYMBOLS_SEARCH_API}${searchValue.name}&token=${process.env.REACT_APP_FINNHUB_TOKEN}`;

      axios
        .get(FINNHUB_COMPANY_SYMBOLS_API)
        .then((response) => resolve(response.data))
        .catch((err) => reject(err));
    });
  };

  const getStockCandles = () => {
    const FINNGUB_STOCK_CANDLES_API = `${process.env.REACT_APP_FINNHUB_STOCK_CANDLES_API}?symbol=${searchValue.name}&resolution=1&from=${searchValue.dateFrom}&to=${searchValue.dateTo}&token=${process.env.REACT_APP_FINNHUB_TOKEN}`;

    try {
      axios.get(FINNGUB_STOCK_CANDLES_API).then((response) => {
        console.log("STOCK CANDLES", response.data);
        setStockCandles(response.data);
      });
    } catch (err) {
      console.log(err);
    }
  };

  return (
    <Styled.Container>
      <Form
        onFormSubmit={onFormSubmit}
        setSearchValue={setSearchValue}
        error={error}
      />
      <CompanyProfiles
        companyProfileValues={companyProfileValues}
        count={count}
        getCompanyProfiles={getCompanyProfiles}
        symbols={symbols}
      />
    </Styled.Container>
  );
};
